      '++LotusScript Development Environment:2:5:(Options):0:66
      Option Public
      
      '++LotusScript Development Environment:2:5:(Forward):0:1
      Declare Sub SetAgent(initType, DBProfile, fServer, AgentName, AgentType)
      Declare Sub InitEnableDisable(initType, agentType)
      
      '++LotusScript Development Environment:2:5:(Declarations):0:2
      Const SNtitle = "Server name"
      Const SNPrompt = "Enter the name of the server on which to run this agent.  If you leave this blank, the agent will be set to run on 'Any Server'."
      '++LotusScript Development Environment:2:2:SetAgent:1:8
      Sub SetAgent(initType, DBProfile, fServer, AgentName, AgentType)
      	If initType = "e" Then
      		AgentName.IsEnabled  = True
      		If Fserver <> "" Then
      			AgentName.ServerName = Fserver
      		End If
      		
      		Call AgentName.save
      		
      		If AgentType = "N" Then
      			dbprofile.NewsletterEnabled = "1"			
      		Elseif AgentType = "F" Then
      			dbprofile.FilingEnabled = "1"
      		Elseif AgentType = "R" Then
      			dbprofile.ReminderEnabled = "1"
      		End If		
      	Elseif initType = "d"  Then
      		AgentName.IsEnabled  = False
      		Call  AgentName.save
      		
      		If AgentType = "N" Then
      			dbprofile.NewsletterEnabled = "0"			
      		Elseif AgentType = "F" Then
      			dbprofile.FilingEnabled = "0"
      		Elseif AgentType = "R" Then
      			dbprofile.ReminderEnabled = "0"
      		End If
      	End If
      End Sub
      '++LotusScript Development Environment:2:2:InitEnableDisable:1:8
      Sub InitEnableDisable(initType, agentType)
      	Dim session As New notessession
      	Dim uiw As New notesuiworkspace
      	Set uidoc = uiw.currentdocument
      	
      	Set db = session.currentdatabase
      	Set DbProfile = db.GetProfileDocument( "TempVars")
      	
      	If agentType = "F" Then
      		Set AgentName = db.getagent("AutoFileAgent")		
      	Elseif AgentType = "N" Then
      		Set AgentName = db.getagent("Send Newsletters")		
      	Elseif AgentType = "R" Then
      		Set AgentName = db.getagent("SendReminder")		
      	End If
      	
      	Dim servername As New notesname(db.server)
      	
      	If initType = "e" Then
      		fServer = uiw.prompt(prompt_okcanceledit, SNtitle, SNprompt, servername.abbreviated)
      		If Isempty(fServer)  Then    'user pressed cancel
      			Exit Sub
      		End If
      	End If
      	
      	If initType = "e" Then		
      		If agentType = "F" Then
      			dbprofile.FilingServer = fServer
      		Elseif AgentType = "N" Then
      			dbprofile.NewsServer = fServer
      		Elseif AgentType = "R" Then
      			dbprofile.ReminderServer = fServer			
      		End If	
      	Elseif initType = "d" Then
      		If agentType = "F" Then
      			dbprofile.FilingServer = ""
      		Elseif AgentType = "N" Then
      			dbprofile.NewsServer = ""
      		Elseif AgentType = "R" Then
      			dbprofile.ReminderServer = ""
      		End If			
      		
      	End If
      	
      	Call SetAgent(initType, DBProfile, fServer, AgentName, AgentType)
      	
      	Call dbprofile.save(True, True)
      	
      	Call uidoc.refresh
      	
      	
      	Exit Sub	
      	
      	
      End Sub
