          '++LotusScript Development Environment:2:5:(Declarations):0:2
          Const Title = "Delete team member, subteam or event"
          '++LotusScript Development Environment:2:2:Click:1:12
          Sub Click(Source As Button)
          	
          	Dim uiwork As New notesuiworkspace
          	Dim uidoc As notesuidocument
          	Dim session As New notessession
          	Dim db As notesdatabase
          	Dim doc As notesdocument
          	Dim dbprofile As notesdocument
          	
          	Set uidoc = uiwork.currentdocument	
          	Set db = session.currentdatabase
          	Set doc=New NotesDocument(db)
          	Set dbprofile = db.getprofiledocument("TempVars")
          	
          	
          	dbprofile.ClientType = "Notes"
          	
          	Call uiwork.DialogBox("DeleteMissionItem", True, True, True, True, True, False, Title, doc, True, True) 'display new created doc
          	
          	doc.form = "DeleteMissionItem"
          	
          	Call uidoc.refresh
          End Sub
